import React from "react";
import {TextField, Button} from '@material-ui/core';

import './styles.scss'

function Input () {
  return (
    <>
    <form autoComplete="off">
      <TextField  className="textField" label="Distance in MGLT?" filled />
      <Button  className="button" variant="contained">stops</Button>
    </form>
    </>
  );
};

export default Input;
